import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import axios from "axios";
import emailSymbol from "./images/email.jpg";
import locationSymbol from "./images/location.jpg";
import messageSymbol from "./images/message.jpg";
import phoneSymbol from "./images/phone.jpg";
import "./HomePage.css";

const HomePage = () => {
  const [jsonData, setJsonData] = useState([]);

  useEffect(() => {
    // Fetch the JSON data from your Flask server
    fetch("/members")
      .then((response) => response.json())
      .then((data) => {
        setJsonData(data);
      })
      .catch((error) => {
        console.error("Error fetching JSON data:", error);
      });
  }, []);

  const handleDelete = (arrayIndex, objIndex) => {
    axios
      .delete(`/delete_data/${arrayIndex}/${objIndex}`)
      .then((response) => {
        console.log(response.data);
        // If deletion is successful, update the state to reflect the change
        setJsonData((prevData) => {
          const newData = [...prevData];
          newData[arrayIndex].splice(objIndex, 1);
          return newData;
        });
      })
      .catch((error) => {
        console.error("Error deleting data:", error);
      });
  };

  return (
    <div>
      <div className="header">
        <div className="allTextHeader">
          <div>
            <p className="Title">HappyHounds</p>
          </div>

          <div className="headerLinks">
            <Link to="/" className="Home-page">
              HOME
            </Link>
            <Link to="/profile" className="profile">
              PROFILE
            </Link>
            <Link to="/login" className="login">
              LOGIN
            </Link>
          </div>
        </div>
      </div>

      <div className="main-content">
        <div className="LeftBox">
          <form onSubmit={handleSubmit}>
            <p className="MessageTitle">Send us a Message</p>

            <input
              type="text"
              placeholder="Enter your subject"
              className="Text-Box-subject"
              value={subject}
              onChange={(e) => setSubject(e.target.value)}
            />
            <textarea
              placeholder="Enter your subject"
              className="Text-Box-main"
              value={mainText}
              onChange={(e) => setMainText(e.target.value)}
            />
            <button type="submit">Submit</button>
            <button onClick={handleClearText}>Clear Text</button>
          </form>
        </div>

        <div className="RightBox">
          <div className="box">
            <img
              src={emailSymbol}
              alt="Example"
              className="Symbol"
              style={{ width: "4vw", height: "auto" }}
            />
            <p>Email us at:</p>
            <p>HappyHounds@gmail.com</p>
          </div>
          <div className="box">
            <img
              src={locationSymbol}
              alt="Example"
              className="Symbol"
              style={{ width: "4vw", height: "auto" }}
            />
            <p>Find us at:</p>
            <p>HappyHounds@gmail.com</p>
          </div>
          <div className="box">
            <img
              src={messageSymbol}
              alt="Example"
              className="Symbol"
              style={{ width: "4vw", height: "auto" }}
            />
            <p>Fax us at:</p>
            <p className="fax-number">+1 (555) 123-4567</p>
          </div>
          <div className="box">
            <img
              src={phoneSymbol}
              alt="Example"
              className="Symbol"
              style={{ width: "4vw", height: "auto" }}
            />
            <p>Call us at:</p>
            <p>+44-3020-647-330</p>
          </div>
        </div>
      </div>

      <div className="footer">
        <Link to="/contact" className="contact">
          CONTACT US
        </Link>
      </div>
    </div>
  );
};

export default HomePage;
